Johnny wants to surprise his wife with a home cooked meal so he heads on over to meet with his wife's friend, Chloe. Chloe is an amazing cook and Johnny can learn a lot from her, but Chloe would rather get stuffed than show Johnny how to make stuffing. Johnny is a little reluctant to bang his wife's friend, but Chloe sucks that wedding ring right off his finger and Johnny instantly forgets about his wife. He might not of cooked anything, but Johnny sure did get dessert.
